import React from 'react';
import style from 'styled-components';
import MovieCard from '../components/MovieCard';

const SearchWrapper = style.div`

    margin-top: 33px;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;


`;


export default function SearchList({ movies }) {
    return (
        <SearchWrapper>
            <MovieCard/>
            <MovieCard/>
            <MovieCard/>
        </SearchWrapper>
    )
}
